import React from 'react'
import classes from './ListOfTasks.css'

const ListOfTasks = (props)=>{
    return(
        <div className={classes.ListOfTasks}>
            <ul>
                {props.tasks.map((task, index)=>{
                    return(
                        <li key={index}>{task.nameOfTask}</li>
                    )
                })}
            </ul>
        </div>

    )

};

export default ListOfTasks
